import React from 'react'
import { Form, Input } from 'antd'

const dummy = {
    isLoggedIn: true
}

// rafce
const Home = () => {
    return (
        <>
            <div>
                {dummy.isLoggedIn && (
                    <Form encType="multipart/form-data">
                        <Input.TextArea maxLength={40} placeholder="무슨 일이 있었나요?"></Input.TextArea>
                    </Form>
                )}
            </div>
        </>
    )
}

export default Home
